import React from 'react';
import { Row, Col, Card, Skeleton } from 'antd';
import CoronaContext from '../context/index';
const GlobalVirus = () => {
	// context: hook of context api
	const { loading, virus } = React.useContext(CoronaContext);
	if (loading === true) {
		return <Skeleton />;
	}
	console.log(virus);
	return (
		<Row>
			<Col span={8}>
				<Card title={'Nhiem benh'}>
					<p>-Moi nhiem: {virus.Global.NewConfirmed}</p>
					<p>-Tong ca nhiem: {virus.Global.NewConfirmed} </p>
				</Card>
			</Col>
			<Col span={8}>
				<Card title={'Tu vong'}>
					<p>-Moi tu vong: {virus.Global.NewDeaths} </p>
					<p>-Tong ca tu vong: {virus.Global.TotalDeaths}</p>
				</Card>
			</Col>
			<Col span={8}>
				<Card title={'Tong so ca khoi benh'}>
					<p>-Moi khoi benh: {virus.Global.NewRecovered} </p>
					<p>-Tong ca khoi benh: {virus.Global.TotalRecovered}</p>
				</Card>
			</Col>
		</Row>
	);
};
export default React.memo(GlobalVirus);
